// Solution 1:
const moveElementToEnd = (arr, toMove) => {
    let left = 0;
    let right = arr.length - 1;

    while(left < right){
        if(arr[right] === toMove && arr[left]!== toMove){
            [arr[left], arr[right]] = [arr[right], arr[left]];
            left++;
            right--;
        } else if(arr[right]!== toMove){
            right--;
        } else if(arr[left] === toMove){
            left++;
        }
    }

    return arr;
}

console.log(moveElementToEnd(['a', 'd', 'd', 'd', 'a', 'a', 'a'], 'a')) // ['a', 'a', 'a', 'a', 'd', 'd', 'd']
console.log(moveElementToEnd(['c', 'c', 'c', 'a', 'a', 'a', 'a'], 'a')) // ['a', 'a', 'a', 'c', 'c', 'c', 'a']
console.log(moveElementToEnd(['d', 'd', 'd', 'a', 'a', 'a', 'a'], 'a')) // ['a', 'a', 'a', 'd', 'd', 'd', 'a']
console.log(moveElementToEnd(['e', 'e', 'e', 'a', 'a', 'a', 'a'], 'a')) // ['a', 'a', 'a', 'e', 'e', 'e', 'a']
